import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';
import OsobaList from './components/OsobaList';

function App() {
    const [zalogowany, setZalogowany] = useState(false);

    const handleZalogujClick = () => {
        setZalogowany(true);
    };

    return (
        <Router>
            <div className="App">
                <h1>Aplikacja</h1>
                {!zalogowany ? (
                    <Link to="/osoby" onClick={handleZalogujClick}>
                        Zaloguj
                    </Link>
                ) : null}
                <Routes>
                    <Route path="/osoby" element={<OsobaList />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
